import React from 'react';

const UpdateItem = ({ onClose }) => {
  return (
    <div>
      <h2>Formulário</h2>
      <form onSubmit={(e) => {
        e.preventDefault();
        // Aqui você pode adicionar a lógica para lidar com o envio do formulário
        onClose(); // Fecha a janela pop-up após o envio do formulário
      }}>
        <label htmlFor="nome">Nome:</label>
        <input type="text" id="nome" name="nome" required /><br /><br />
        <label htmlFor="quantidade">Quantidade:</label>
        <input type="number" id="quantidade" name="quantidade" required /><br /><br />
        <label htmlFor="valor">Valor:</label>
        <input type="number" id="valor" name="valor" required /><br /><br />
        <button type="submit">Enviar</button>
      </form>
    </div>
  );
};

export default UpdateItem;
